import { Stack } from "@chakra-ui/layout";
import { Skeleton } from "@chakra-ui/skeleton";
import React from "react";

function ChatLoading() {
  return (
    <div>
      <Stack>
        <Skeleton height="200px" />
      </Stack>
    </div>
  );
}

export default ChatLoading;
